]

    "height": 300,

        {

}

        "transform": [
            {

                    {
                        "op": "count",
                        "as": "xy_count"
                    }
                ],
                "groupby": [
                    "predicted",
                    "actual"
                ]
            },
            {
                "impute": "xy_count",
                "groupby": [
                    "rev",
                    "predicted"
                ],
                "key": "actual",
                "value": 0
            },
            {
                "impute": "xy_count",
                "groupby": [
                    "rev",
                    "actual"
                ],
                "key": "predicted",
                "value": 0
            },
            {

                        "op": "max",
                        "field": "xy_count",
                        "as": "max_count"
                    }
                ],
                "groupby": []
            },
            {
                "calculate": "datum.xy_count / datum.max_count",
                "as": "percent_of_max"
            }
        ],
        "encoding": {

                        },
                        "value": "black"
                    }

            }
